function pixelArrayToImage(pixels) {
    const width = 28;
    const height = 28;
    const rgba = Buffer.alloc(width * height * 4);
    let i = 0;
    for (const px of pixels) {
        const gray = Math.round(px * 255);
        rgba[i++] = gray; // R
        rgba[i++] = gray; // G
        rgba[i++] = gray; // B
        rgba[i++] = gray; // A
    }
    return rgba;
}
